import React from 'react';
import './App.css';

function App() {
  return (
    <div className="container-fluid">
      <h1>Filmes exclusivos dos maiores estúdios<span>É só dar um play</span></h1>
      <p>Curta 7 dias grátis, assine por R$37,90/mês e cancele quando quiser.</p>
    </div>
  );
}

export default App;
